def is_distinct(n):
    """
    Returns True if the digits of n are distinct, False otherwise.
    """
    digits = []
    while n > 0:
        digits.append(n % 10)
        n //= 10
    return len(digits) == len(set(digits))

def main():
    count = 0
    for n in range(100, 1000):
        if n % 2 == 1 and is_distinct(n):
            count += 1
    print(count)

if __name__ == '__main__':
    main()

