import sympy

def compute_x():
    x = 12/35 * sympy.Matrix([-3, 5, -1])
    return x

def compute_projection(v, u):
    return (v.dot(u) / u.dot(u)) * u

def compute_z(x):
    v = sympy.Matrix([0, 3, sympy.symbols('z')])
    u = sympy.Matrix([-3, 5, -1])
    return sympy.solve(compute_projection(v, u) - x, sympy.symbols('z'))

if __name__ == '__main__':
    x = compute_x()
    print(x)
    print(compute_z(x))
